import React from 'react';
import {  Link } from 'react-router-dom';


class homeScreen extends React.Component {

    render(){
        return (
            <div className="App-header">
                <h1 className="App">
                    <Link to="/">home</Link>

                </h1>
                <text>
                A son and his father were walking on the mountains. Suddenly, his son falls, hurts himself and screams: "Aaahhh!!!" To his surprise, he hears the voice repeating, somewhere in the mountain: "AAAhhhhhh!!!" Curious, he yells: "Who are you?" He receives the answer: "Who are you?" And then he screams to the mountain: "I admire you!" The voice answers:"I admire you!" Angered at the response, he screams: "Coward!" He receives the answer: "Coward!" He looks to his father and asks: "What's going on?" 
  The father smiles and says: "My son, pay attention." Again the man screams: "You are a champion!" The voice answers: "You are a champion!" The boy is surprised, but does not understand. Then the father explains: "People call this 'echo', but really this is 'life'. It gives you back everything you say or do. 
   Our life is simply a reflection of our actions. If you want more love in the world, create more love in your heart. If you want more competence in your team, improve your competence. 
  This relationship applies to everything, in all aspect of life; Life will give you back everything you have given to it." Your life is not a coincidence. It's a reflection of you!"
                </text>

            </div>
        )
    }
}

export default homeScreen;
